import React, { useState } from 'react';
import { Plus, Edit2, Trash2, Save, X, AlertCircle } from 'lucide-react';

const Category = () => {
  const [categories, setCategories] = useState([
    {
      CategoryID: 1,
      CategoryCode: 'CAT-001',
      CategoryName: 'Plastic',
      Description: 'All types of plastic waste materials',
      RecyclingInstructions: 'Rinse before disposal. Remove caps and labels.',
      HazardLevel: 'Low',
      IsActive: true,
      CreatedAt: '2024-01-15 10:30',
      UpdatedAt: '2024-03-15 14:20'
    },
    {
      CategoryID: 2,
      CategoryCode: 'CAT-002',
      CategoryName: 'Organic',
      Description: 'Biodegradable organic waste',
      RecyclingInstructions: 'Separate food waste from packaging.',
      HazardLevel: 'Low',
      IsActive: true,
      CreatedAt: '2024-01-15 09:45',
      UpdatedAt: '2024-03-10 11:30'
    },
    {
      CategoryID: 3,
      CategoryCode: 'CAT-003',
      CategoryName: 'Electronic',
      Description: 'E-waste and electronic devices',
      RecyclingInstructions: 'Remove batteries. Handle with care.',
      HazardLevel: 'High',
      IsActive: true,
      CreatedAt: '2024-02-01 08:15',
      UpdatedAt: '2024-03-12 16:45'
    },
    {
      CategoryID: 4,
      CategoryCode: 'CAT-004',
      CategoryName: 'Glass',
      Description: 'Glass bottles and containers',
      RecyclingInstructions: 'Clean and separate by color.',
      HazardLevel: 'Medium',
      IsActive: true,
      CreatedAt: '2024-02-05 12:00',
      UpdatedAt: '2024-03-14 09:20'
    }
  ]);

  const [showForm, setShowForm] = useState(false);
  const [editingId, setEditingId] = useState(null);
  const [formData, setFormData] = useState({
    CategoryCode: '',
    CategoryName: '',
    Description: '',
    RecyclingInstructions: '',
    HazardLevel: 'Low',
    IsActive: true
  });

  const handleAdd = () => {
    setFormData({
      CategoryCode: '',
      CategoryName: '',
      Description: '',
      RecyclingInstructions: '',
      HazardLevel: 'Low',
      IsActive: true
    });
    setEditingId(null);
    setShowForm(true);
  };

  const handleEdit = (category) => {
    setFormData({
      CategoryCode: category.CategoryCode,
      CategoryName: category.CategoryName,
      Description: category.Description,
      RecyclingInstructions: category.RecyclingInstructions,
      HazardLevel: category.HazardLevel,
      IsActive: category.IsActive
    });
    setEditingId(category.CategoryID);
    setShowForm(true);
  };

  const handleDelete = (id) => {
    if (window.confirm('Are you sure you want to delete this category?')) {
      setCategories(categories.filter(cat => cat.CategoryID !== id));
    }
  };

  const handleSubmit = () => {
    if (editingId) {
      setCategories(categories.map(cat => 
        cat.CategoryID === editingId 
          ? { 
              ...cat, 
              ...formData, 
              UpdatedAt: new Date().toISOString().slice(0, 16).replace('T', ' ')
            }
          : cat
      ));
    } else {
      const newCategory = {
        CategoryID: Math.max(...categories.map(c => c.CategoryID)) + 1,
        ...formData,
        CreatedAt: new Date().toISOString().slice(0, 16).replace('T', ' '),
        UpdatedAt: new Date().toISOString().slice(0, 16).replace('T', ' ')
      };
      setCategories([...categories, newCategory]);
    }
    
    setShowForm(false);
    setEditingId(null);
  };

  const handleCancel = () => {
    setShowForm(false);
    setEditingId(null);
  };

  const getHazardColor = (level) => {
    switch(level) {
      case 'Low': return 'text-emerald-600 bg-emerald-50';
      case 'Medium': return 'text-amber-600 bg-amber-50';
      case 'High': return 'text-red-600 bg-red-50';
      default: return 'text-gray-600 bg-gray-50';
    }
  };

  return (
    <div className="min-h-screen bg-gradient-to-br from-lime-50 to-lime-100 p-8">
      <div className="max-w-7xl mx-auto">
        <div className="flex items-center justify-between mb-8">
          <div>
            <h1 className="text-3xl font-bold text-gray-900 mb-2">Waste Categories</h1>
            <p className="text-gray-600">Manage waste categories and recycling instructions</p>
          </div>
          {!showForm && (
            <button
              onClick={handleAdd}
              className="flex items-center gap-2 bg-emerald-500 hover:bg-emerald-600 text-white font-semibold px-6 py-3 rounded-lg transition-colors"
            >
              <Plus size={20} />
              Add Category
            </button>
          )}
        </div>

        {showForm && (
          <div className="bg-white rounded-2xl shadow-lg p-8 mb-8">
            <div className="flex items-center justify-between mb-6">
              <h2 className="text-2xl font-bold text-gray-900">
                {editingId ? 'Edit Category' : 'Add New Category'}
              </h2>
              <button
                onClick={handleCancel}
                className="text-gray-400 hover:text-gray-600 transition-colors"
              >
                <X size={24} />
              </button>
            </div>

            <div className="space-y-6">
              <div className="grid grid-cols-2 gap-6">
                <div>
                  <label className="block text-sm font-semibold text-gray-700 mb-2">
                    Category Code
                  </label>
                  <input
                    type="text"
                    value={formData.CategoryCode}
                    onChange={(e) => setFormData({...formData, CategoryCode: e.target.value})}
                    placeholder="e.g., CAT-005"
                    className="w-full px-4 py-3 border border-gray-200 rounded-lg focus:outline-none focus:ring-2 focus:ring-emerald-500"
                  />
                </div>

                <div>
                  <label className="block text-sm font-semibold text-gray-700 mb-2">
                    Category Name
                  </label>
                  <input
                    type="text"
                    value={formData.CategoryName}
                    onChange={(e) => setFormData({...formData, CategoryName: e.target.value})}
                    placeholder="e.g., Plastics"
                    className="w-full px-4 py-3 border border-gray-200 rounded-lg focus:outline-none focus:ring-2 focus:ring-emerald-500"
                  />
                </div>
              </div>

              <div>
                <label className="block text-sm font-semibold text-gray-700 mb-2">
                  Description
                </label>
                <textarea
                  value={formData.Description}
                  onChange={(e) => setFormData({...formData, Description: e.target.value})}
                  placeholder="Brief description of the waste category..."
                  rows={3}
                  className="w-full px-4 py-3 border border-gray-200 rounded-lg focus:outline-none focus:ring-2 focus:ring-emerald-500 resize-none"
                ></textarea>
              </div>

              <div>
                <label className="block text-sm font-semibold text-gray-700 mb-2">
                  Recycling Instructions
                </label>
                <textarea
                  value={formData.RecyclingInstructions}
                  onChange={(e) => setFormData({...formData, RecyclingInstructions: e.target.value})}
                  placeholder="e.g., Rinse before disposal. Remove caps and labels..."
                  rows={4}
                  className="w-full px-4 py-3 border border-gray-200 rounded-lg focus:outline-none focus:ring-2 focus:ring-emerald-500 resize-none"
                ></textarea>
              </div>

              <div className="grid grid-cols-2 gap-6">
                <div>
                  <label className="block text-sm font-semibold text-gray-700 mb-2">
                    Hazard Level
                  </label>
                  <select
                    value={formData.HazardLevel}
                    onChange={(e) => setFormData({...formData, HazardLevel: e.target.value})}
                    className="w-full px-4 py-3 border border-gray-200 rounded-lg focus:outline-none focus:ring-2 focus:ring-emerald-500"
                  >
                    <option value="Low">Low</option>
                    <option value="Medium">Medium</option>
                    <option value="High">High</option>
                  </select>
                </div>

                <div>
                  <label className="block text-sm font-semibold text-gray-700 mb-2">
                    Status
                  </label>
                  <label className="flex items-center gap-3 px-4 py-3">
                    <input
                      type="checkbox"
                      checked={formData.IsActive}
                      onChange={(e) => setFormData({...formData, IsActive: e.target.checked})}
                      className="w-5 h-5 text-emerald-500 rounded focus:ring-emerald-500"
                    />
                    <span className="text-gray-700 font-medium">Active</span>
                  </label>
                </div>
              </div>

              <div className="flex gap-4 pt-4">
                <button
                  onClick={handleSubmit}
                  className="flex items-center gap-2 bg-emerald-500 hover:bg-emerald-600 text-white font-semibold px-6 py-3 rounded-lg transition-colors"
                >
                  <Save size={20} />
                  {editingId ? 'Update Category' : 'Save Category'}
                </button>
                <button
                  onClick={handleCancel}
                  className="px-6 py-3 border-2 border-gray-300 text-gray-700 font-semibold rounded-lg hover:bg-gray-50 transition-colors"
                >
                  Cancel
                </button>
              </div>
            </div>
          </div>
        )}

        {!showForm && (
          <div className="bg-white rounded-2xl shadow-lg overflow-hidden">
            <div className="overflow-x-auto">
              <table className="w-full">
                <thead className="bg-gray-50 border-b border-gray-200">
                  <tr>
                    <th className="px-6 py-4 text-left text-xs font-semibold text-gray-600 uppercase tracking-wider">Code</th>
                    <th className="px-6 py-4 text-left text-xs font-semibold text-gray-600 uppercase tracking-wider">Category Name</th>
                    <th className="px-6 py-4 text-left text-xs font-semibold text-gray-600 uppercase tracking-wider">Description</th>
                    <th className="px-6 py-4 text-left text-xs font-semibold text-gray-600 uppercase tracking-wider">Hazard Level</th>
                    <th className="px-6 py-4 text-left text-xs font-semibold text-gray-600 uppercase tracking-wider">Status</th>
                    <th className="px-6 py-4 text-left text-xs font-semibold text-gray-600 uppercase tracking-wider">Updated At</th>
                    <th className="px-6 py-4 text-left text-xs font-semibold text-gray-600 uppercase tracking-wider">Actions</th>
                  </tr>
                </thead>
                <tbody className="divide-y divide-gray-200">
                  {categories.map((category) => (
                    <tr key={category.CategoryID} className="hover:bg-gray-50 transition-colors">
                      <td className="px-6 py-4 whitespace-nowrap">
                        <span className="text-sm font-medium text-emerald-600">{category.CategoryCode}</span>
                      </td>
                      <td className="px-6 py-4 whitespace-nowrap">
                        <span className="text-sm font-semibold text-gray-900">{category.CategoryName}</span>
                      </td>
                      <td className="px-6 py-4">
                        <span className="text-sm text-gray-600 line-clamp-2">{category.Description}</span>
                      </td>
                      <td className="px-6 py-4 whitespace-nowrap">
                        <span className={`inline-flex items-center gap-1 px-3 py-1 rounded-full text-xs font-semibold ${getHazardColor(category.HazardLevel)}`}>
                          <AlertCircle size={14} />
                          {category.HazardLevel}
                        </span>
                      </td>
                      <td className="px-6 py-4 whitespace-nowrap">
                        <span className={`px-3 py-1 rounded-full text-xs font-semibold ${
                          category.IsActive ? 'bg-emerald-100 text-emerald-700' : 'bg-gray-100 text-gray-600'
                        }`}>
                          {category.IsActive ? 'Active' : 'Inactive'}
                        </span>
                      </td>
                      <td className="px-6 py-4 whitespace-nowrap">
                        <span className="text-sm text-gray-600">{category.UpdatedAt}</span>
                      </td>
                      <td className="px-6 py-4 whitespace-nowrap">
                        <div className="flex items-center gap-2">
                          <button
                            onClick={() => handleEdit(category)}
                            className="p-2 text-blue-600 hover:bg-blue-50 rounded-lg transition-colors"
                            title="Edit"
                          >
                            <Edit2 size={18} />
                          </button>
                          <button
                            onClick={() => handleDelete(category.CategoryID)}
                            className="p-2 text-red-600 hover:bg-red-50 rounded-lg transition-colors"
                            title="Delete"
                          >
                            <Trash2 size={18} />
                          </button>
                        </div>
                      </td>
                    </tr>
                  ))}
                </tbody>
              </table>
            </div>
          </div>
        )}
      </div>
    </div>
  );
};

export default Category;
